import React from 'react';
import {data} from "../data/data";




import './app.css';

class App extends React.Component{
    state ={
        people: data
    }
    render() {
        return(
            <div className='container'>
                <h1>Products</h1>
                {
                    this.state.people.map(el => (
                        <p>
                            {
                                el.firstName
                            }
                        </p>
                    ))
                }
            </div>
        )
    }
}
export default App;
